INSERT INTO `dts_article` VALUES (1, '1', '平台1.0版本正式发布上线', '<p>&nbsp;&nbsp;感谢广大用户长期以来对揭阳特色农产品的支持和信赖，为了更好的服务于广大购物用户，经过数月的开发和内测，新升级版本将于2025年5月20日全面上线试运行。系统在整体风格、交易模式、版块设置、农产品种类、用户体验、使用功能等方面全面升级，更好的为农户和用户提供农产品批发和零售服务。现将有关事项公告如下：</p>\n<p>&nbsp;&nbsp; <strong>一． 试运行期间推出优惠活动，诚邀各类农产品批发商，希望能与提供物美价廉的农户们一同合作</strong></p>\n<p>&nbsp;&nbsp; <strong>二． 试运行期间诚邀各种推广代理商及个人，平台提供农产品批发及零售，平台提供佣金服务，具体请联系客服了解。</strong></p>\n<center><strong>揭阳农产品交易系统</strong></center>', '2025-03-17 22:23:13', '2025-03-21 23:53:32', 1);
INSERT INTO `dts_article` VALUES (2, '1', '全场优惠券大放送,敬请关注', '<ul style=\"list-style-type: square;\">\n<li><span style=\"text-decoration: underline;\"><strong><span style=\"color: #00ccff; text-decoration: underline;\">平台将从试运行阶段开始，提供各种优惠券领取活动，敬请广大用户关注。</span></strong></span></li>\n</ul>', '2025-03-16 22:24:02', '2025-03-16 22:24:02', 1);
INSERT INTO `dts_article` VALUES (3, '1', '“草莓皇后”王红：小草莓种出大产业，带领乡亲共致富', '<p>&nbsp;&nbsp;“草莓皇后”王红：小草莓种出大产业，带领乡亲共致富</p>\n<p>&nbsp;&nbsp; <strong>王红原本是一名普通的农村妇女，偶然接触到草莓种植后，便潜心钻研技术，克服了重重困难，最终成功培育出高品质草莓。她不仅自己致富，还成立了合作社，免费为乡亲们提供技术指导和销售渠道，带动周边村庄发展草莓种植，形成了规模化的草莓产业，让乡亲们的生活越来越红火。</strong></p>\n<center><strong>揭阳农产品交易系统</strong></center>', '2025-03-16 22:24:02', '2025-03-16 22:24:02', 0);
INSERT INTO `dts_article` VALUES (4, '1', '“生态卫士”李强：守护青山绿水，打造绿色生态家园', '<p>&nbsp;&nbsp;“草莓皇后”王红：小草莓种出大产业，带领乡亲共致富</p>\n<p>&nbsp;&nbsp; <strong>李强是土生土长的山里人，他深知绿水青山就是金山银山的道理。为了保护家乡的生态环境，他毅然放弃了外出打工的机会，回乡承包荒山，种植果树，发展林下经济。他坚持不使用化肥农药，采用生态种植模式，打造出绿色有机农产品品牌，不仅实现了经济效益，更改善了当地的生态环境，为子孙后代留下了宝贵的绿色财富。</strong></p>\n<center><strong>揭阳农产品交易系统</strong></center>', '2025-03-16 22:24:02', '2025-03-16 22:24:02', 0);
INSERT INTO `dts_article` VALUES (5, '1', '“电商达人”张丽：巧用互联网，让农产品飞出大山', '<p>&nbsp;&nbsp;“草莓皇后”王红：小草莓种出大产业，带领乡亲共致富</p>\n<p>&nbsp;&nbsp; <strong>张丽是一名返乡创业的大学生，她敏锐地察觉到互联网的巨大潜力，利用电商平台将家乡的特色农产品销往全国各地。她组建团队，打造品牌，利用直播带货等新型营销方式，将大山深处的优质农产品推广出去，解决了农产品销售难的问题，带动了当地农民增收致富，为乡村振兴注入了新的活力。</strong></p>\n<center><strong>揭阳农产品交易系统</strong></center>', '2025-03-16 22:24:02', '2025-03-16 22:24:02', 0);
INSERT INTO `dts_brand` VALUES (1001000, '揭阳特色农产品官方总店', '揭阳农产品琳琅满目，其中普宁蕉柑被誉为“柑桔皇后”，果大味甜；惠来荔枝色鲜香甜，品种多样，尤以“玉荷包”著称；而邹堂青皮梨则以其细脆多汁、甜中微酸的口感深受喜爱，这些农产品共同展现了揭阳丰富的自然馈赠和独特的农业魅力。', 'https://img0.baidu.com/it/u=3324051833,1235291717&fm=253&fmt=auto&app=138&f=JPEG?w=888&h=500', 1, 0.00, '2018-02-01 00:00:00', '2019-12-15 13:09:39', 'https://github.com/helloboy829/', 5, 0, '揭阳特色农产品官方总店', 0, 'https://github.com/helloboy829/', 100100704, 4, 15, NULL, NULL, NULL, NULL);
INSERT INTO `dts_brand` VALUES (1001016, '绿野仙踪·揭阳柑韵官方旗舰店', '绿野仙踪·揭阳柑韵源自揭阳普宁的青山绿水之间，每一颗蕉柑都沐浴着充足的阳光和纯净的雨露，自然生长，精心培育。品牌以“传承经典，品味自然”为理念，致力于将这份大自然的馈赠以最完美的状态呈现给每一位消费者。每一口咬下，都是对揭阳这片土地的深情致敬，让人仿佛置身于绿野仙踪之中，品味着揭阳柑的独特韵味。', 'https://img0.baidu.com/it/u=3700160583,2875680081&fm=253&fmt=auto&app=138&f=JPEG?w=607&h=405', 17, 10.00, '2019-10-29 00:00:00', '2020-03-21 14:07:30', '', 5, 0, '绿野仙踪·揭阳柑韵官方旗舰店', 0, 'https://github.com/helloboy829/', 100101003, 10, 15, '普宁', 112.8609380, 28.1982440, '[\"09:00 - 18:30\"]');
INSERT INTO `dts_brand` VALUES (1001073, '甜蜜蜜·惠来荔香园官方旗舰店', '甜蜜蜜·惠来荔香园，一个充满甜蜜与浪漫的品牌。它源自揭阳惠来这片肥沃的土地，这里孕育着色泽鲜艳、香气扑鼻的荔枝。品牌以“甜蜜分享，荔香四溢”为口号，将每一颗荔枝都视为大自然的瑰宝，精心采摘，严格筛选，确保每一颗荔枝都饱满多汁、口感绝佳。无论是作为礼物还是自家享用，甜蜜蜜·惠来荔香园都能带给人们满满的幸福感和甜蜜的回忆。', 'https://img0.baidu.com/it/u=872042412,3518170631&fm=253&fmt=auto&app=120&f=JPEG?w=457&h=456', 74, 20.00, '2019-10-20 19:13:52', '2020-03-26 19:53:01', '', 5, 0, '甜蜜蜜·惠来荔香园官方旗舰店', 0, 'https://github.com/helloboy829/', 100100602, 12, 15, '惠来', 113.3210370, 23.1179010, NULL);
