INSERT INTO `dts_goods` VALUES (23858, '30011', '惠来荔枝', 100100202, 1001073, '[\"http://localhost:8080/wx/storage/fetch/rtp32ppcssodyukxwbtz.png\"]', '荔枝,荔', '惠来荔枝--日啖荔枝三百颗 不辞长作岭南人', 1, 100, 'http://localhost:8080/wx/storage/fetch/tz8iq7d3uhymikatid42.png', '', 1, 1, '斤', 39.90, 29.90, '<p>揭阳惠来是广东荔枝主产区，赤壳品种果皮鲜红，肉厚核小，含多种维生素，明清时期即为贡品</p>', '2025-03-27 14:37:03', '2025-05-09 13:32:23', 28, 17, 0, NULL, NULL, 0, NULL, 0, NULL);
INSERT INTO `dts_goods` VALUES (23859, '30012', '揭东竹笋', 100100602, 1001000, '[\"http://localhost:8080/wx/storage/fetch/kuak3fgmznesxankri8q.png\"]', '揭东,竹笋', '揭东竹笋是广东省揭东县的特产', 1, 100, 'http://localhost:8080/wx/storage/fetch/yustjpdp7ywy5ftqogpt.png', NULL, 0, 0, '斤', 19.90, 15.50, '<div class=\"lemmaSummary_WgHTy J-summary\">\n<div class=\"para_tCZgr summary_rgzSU MARK_MODULE\" data-tag=\"paragraph\" data-uuid=\"usyfyEGcWH9o\" data-idx=\"\"><span class=\"text_ETaXO\" data-text=\"true\">竹笋，自古被视为&ldquo;菜中珍品&rdquo;。清代文人李笠翁把竹笋誉为&ldquo;蔬菜中第一品&rdquo;，认为肥羊嫩豕也比不上它。</span></div>\n<div class=\"para_tCZgr summary_rgzSU MARK_MODULE\" data-tag=\"paragraph\" data-uuid=\"gn3llicwpf\" data-idx=\"\"><span class=\"text_ETaXO\" data-text=\"true\">据分析，每百克冬笋含蛋白质4.1克，脂肪0.1克，碳水化合物5.7克，钙22毫克，磷56毫克，铁0.1毫克，并含有</span><span class=\"text_ETaXO\" data-text=\"true\"><a class=\"innerLink_rQ5YJ\" href=\"https://baike.baidu.com/item/%E7%BB%B4%E7%94%9F%E7%B4%A0B1/2628730?fromModule=lemma_inlink\" target=\"_blank\" rel=\"noopener\" data-from-module=\"summary\">维生素B1</a></span><span class=\"text_ETaXO\" data-text=\"true\">、</span><span class=\"text_ETaXO\" data-text=\"true\"><a class=\"innerLink_rQ5YJ\" href=\"https://baike.baidu.com/item/%E7%BB%B4%E7%94%9F%E7%B4%A0B2/2625885?fromModule=lemma_inlink\" target=\"_blank\" rel=\"noopener\" data-from-module=\"summary\">维生素B2</a></span><span class=\"text_ETaXO\" data-text=\"true\">、</span><span class=\"text_ETaXO\" data-text=\"true\"><a class=\"innerLink_rQ5YJ\" href=\"https://baike.baidu.com/item/%E7%BB%B4%E7%94%9F%E7%B4%A0C/380582?fromModule=lemma_inlink\" target=\"_blank\" rel=\"noopener\" data-from-module=\"summary\">维生素C</a></span><span class=\"text_ETaXO\" data-text=\"true\">及</span><span class=\"text_ETaXO\" data-text=\"true\"><a class=\"innerLink_rQ5YJ\" href=\"https://baike.baidu.com/item/%E8%83%A1%E8%90%9D%E5%8D%9C%E7%B4%A0/5180332?fromModule=lemma_inlink\" target=\"_blank\" rel=\"noopener\" data-from-module=\"summary\">胡萝卜素</a></span><span class=\"text_ETaXO\" data-text=\"true\">等多种维生素。竹笋中所含的蛋白质比较优越，人体所需的赖氨酸、色氨酸、苏氨酸、</span><span class=\"text_ETaXO\" data-text=\"true\"><a class=\"innerLink_rQ5YJ\" href=\"https://baike.baidu.com/item/%E8%8B%AF%E4%B8%99%E6%B0%A8%E9%85%B8/7613951?fromModule=lemma_inlink\" target=\"_blank\" rel=\"noopener\" data-from-module=\"summary\">苯丙氨酸</a></span><span class=\"text_ETaXO\" data-text=\"true\">、谷氨酸、胱氨酸等，都有一定含量。另外，竹笋具有低脂肪、低糖、高纤维素等特点，食用竹笋能促进肠道蠕动、帮助消化、促进排便，是理想的减肥佳蔬。</span></div>\n<div class=\"para_tCZgr summary_rgzSU MARK_MODULE\" data-tag=\"paragraph\" data-uuid=\"gn3llicwr0\" data-idx=\"\"><span class=\"text_ETaXO\" data-text=\"true\">竹笋不仅脆嫩鲜美，而且对人体大有益处。古代人对此早有认识。《本草纲目》概括竹笋诸功能为：消渴、利水道、益气、化热、消痰、爽胃。如治疗肾炎、心脏病、肝病等的浮肿腹水，可用竹笋、陈蒲瓜各100克，或加冬瓜皮50克，水煎服；治疗久泻、久痢及脱肛等症，可用鲜竹笋煮白米粥食之。以毛竹笋烧猪肉、鸡肉，是春夏的滋补佳品。此外，竹笋对防治咳喘、糖尿病、高血压、烦渴、失眠等症，也有较好的疗效。</span></div>\n</div>\n<div class=\"skeletonWrap_DEOeM\">\n<div class=\"skeletonContent_UoCqa\">&nbsp;</div>\n</div>', '2025-03-27 15:18:15', '2025-03-27 15:18:15', 0, 0, 0, NULL, NULL, 0, NULL, 0, NULL);
INSERT INTO `dts_goods` VALUES (23860, '30013', '菜脯', 100100203, 1001000, '[\"http://localhost:8080/wx/storage/fetch/553chpgjm1nt1pum5a5i.png\"]', '菜脯,萝卜干', '萝卜干，是指晒干的萝卜，是国内大众喜爱一种独具风味的易保存干蔬菜', 1, 100, 'http://localhost:8080/wx/storage/fetch/o512ndcrkp28hzev0vkw.png', NULL, 0, 1, '包', 15.00, 9.90, '<div class=\"para_tCZgr summary_rgzSU MARK_MODULE\" data-tag=\"paragraph\" data-uuid=\"gnx3nws5y9\" data-idx=\"\"><span class=\"text_ETaXO\" data-text=\"true\">萝卜干，是指晒干的萝卜，是国内大众喜爱一种独具风味的易保存干蔬菜。富含</span><span class=\"text_ETaXO\" data-text=\"true\"><a class=\"innerLink_rQ5YJ\" href=\"https://baike.baidu.com/item/%E7%BB%B4%E7%94%9F%E7%B4%A0B/1140841?fromModule=lemma_inlink\" target=\"_blank\" rel=\"noopener\" data-from-module=\"summary\">维生素B</a></span><span class=\"text_ETaXO\" data-text=\"true\">，铁质含量除金针菜外高过其他食物。萝卜干在潮汕称菜脯，咸香脆口，消食开胃，与潮汕咸菜、鱼露并称潮汕三宝。上杭萝卜干色泽金黄，皮嫩肉脆，甘香味美，明初即享有盛名。</span></div>\n<div class=\"para_tCZgr summary_rgzSU MARK_MODULE\" data-tag=\"paragraph\" data-uuid=\"gnx3okn1z8\" data-idx=\"\"><span class=\"text_ETaXO\" data-text=\"true\">萝卜干制作一般是在冬至前后进行，要经过&ldquo;晒、腌、藏&rdquo;三道工序。将萝卜拔出洗净，放太阳下曝晒后用盐围实，一层萝卜一层盐，装满后上盖，再压上大石块，晚间收回。</span></div>', '2025-03-27 15:43:37', '2025-03-27 15:43:37', 0, 0, 0, NULL, NULL, 0, NULL, 0, NULL);
INSERT INTO `dts_goods` VALUES (23861, '30020', '金鲳鱼', 100100801, 1001073, '[\"http://localhost:8080/wx/storage/fetch/i5e0oxtlwuuei5eu3lxn.png\"]', '鱼,金鲳鱼,金鲳', '金鲳鱼无肌间刺、肉质细嫩、味道鲜美， 含有丰富的蛋白质、碳水化合物、不饱和脂肪酸以及微量元素等多种营养成分， 历来被列为名贵食用鱼类。', 1, 100, 'http://localhost:8080/wx/storage/fetch/r4tau7qh0orc2sz2awpn.png', '', 0, 1, '斤', 29.90, 26.90, '<p>金鲳鱼无肌间刺、肉质细嫩、味道鲜美， 含有丰富的蛋白质、碳水化合物、不饱和脂肪酸以及微量元素等多种营养成分， 历来被列为名贵食用鱼类。</p>', '2025-03-28 15:13:03', '2025-05-09 10:37:23', 1, 0, 0, NULL, NULL, 0, NULL, 0, NULL);
